import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  border-radius: 4px;
  background: #ecf0f1;
  padding: 1em;
`;

const DataStatus = ({ data }) => (
  <Wrapper>
    <FiUsers />
    {data.length}
    DataSet loaded
  </Wrapper>
);

export default DataStatus;
